export function insertionSort(array) {
  const animations = [];
  for (let i = 1; i < array.length - 1; i++) {
    let j = i;

    while (j > 0 && array[j - 1] > array[j]) {
      let temp = array[j];
      array[j] = array[j - 1];
      array[j - 1] = temp;
      j = j - 1;
    }
  }

  return array;
}

function swap(array, j) {
  let temp = array[j];
  array[j] = array[j - 1];
  array[j - 1] = temp;
}
